yield 只能用在ES6新增的生成器函数中，以回送生成的值序列中的下一个值，又不会真正返回。
function * foo(x){
    while(true){
        x=x*2;
        yield x;
    }
}

//当调用foo时，会得到一个具有next 方法的Generator对象。
var g=foo(2);
g.next();//4
g.next();//8

即yield 类似return ，但return 返回值x,而yield 返回一个函数，该函数提供一个迭代下一个值的方法。
yield关键字只是帮助异步地随时暂停和恢复功能。
另外，它有助于从生成器函数返回值。
