function fetchAndDecode(url,type){
    return fetch(url).then(response=>{
        if(type==='blob'){
            return response.blob();
        }
        else if(type==='text'){
            return response.text();
        }
    })
    .catch(e=>{
        console.log(there has been a problem with your fetch operation'+e.message);
    });
}

