1.定义：要用的属性不存在，要通过已有属性计算得来。
2.原理：底层借助object.defineProperty方法提供的getter&setter.
3.get函数什么时候执行？
​    (1)初次读取时会执行一次，再读就不调用了（因为有缓存）
​    (2)当依赖的数据发生改变时会被再次调用。
4.优势：与methods实现相比，内部有缓存机制（复用），效率更高，调试方便。
5.备注：
​    (1)计算属性最终会出现在vm上，直接读取使用即可。
​    (2)如果计算属性要被修改，则必须写set函数去响应修改，且set中要引起计算时依赖的数据发生改变。
必要性：在模板中加入太多逻辑会使模板过重且难以维护。

    {{message.split('').reverse().join('')}}


对于复杂逻辑，应当使用计算属性
例：

    original message:'{{message}}'
    computed reversed message:'{{reversedMessage}}'



    var vm=new Vue({
        el:'#example',
        data:{
            message:'hello'
        },
        computed:{
            //计算属性的getter
            reversedMessage:function(){
                //this指向vm实例
                return this.message.split('').reverse().join('')
            }
        }
    })


上式声明了一个计算属性reversedMessage，提供的函数将用作propertyvm.reversedMessage的getter函数：

console.log(vm.reversedMessage)//=>'olleh'
vm.message='goodbye'
console.log(vm.reversedMessage)//=>'eybdoog'

计算属性缓存 和 方法
Reversed message: "{{ reversedMessage() }}"


// 在组件中
methods: {
  reversedMessage: function () {
    return this.message.split('').reverse().join('')
  }
}

不同的计算属性是基于它们的响应式依赖进行缓存的，只在相关响应式依赖发生改变时它们才会重新求值，即只要message还没有发生改变，多次访问reversedMessage计算属性会立即返回之前的计算结果，而不必再次执行函数。
下面的计算属性将不再更新，因为Date.now()不是响应式依赖：
computed:{
    now:function(){
        return Date.now();
    }
}

与之相比，每当触发重新渲染时，调用方法总会再次执行函数。
计算属性VS监听属性
监听属性用来观察和响应vue实例上的数据变动。
若有一些数据需要随着其他数据变动而变动，很容易滥用watch,更好的做法是使用计算属性而不是命令式的watch回调。
